import ExpenseItem from "./components/ExpenseItem";

function App() {
  const expenses = [
    { date: new Date, title: "Car Insurance", amount: 297.5 },
    { date: 250, title: "New Tv", amount: 183.75 },
    { date: 250, title: "Travel", amount: 584.83 },
    { date: 250, title: "Medical", amount: 52.36 },
  ];
  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem expense={expenses[0]}/>
      <ExpenseItem expense={expenses[1]}/>
      <ExpenseItem expense={expenses[2]}/>
      <ExpenseItem expense={expenses[3]}/>
    </div>
  );
}

export default App;
